import React, { useState } from 'react';
import './_create-recipe.css';

const CreateRecipe = ({ onClose, onAddRecipe }) => {
    const [steps, setSteps] = useState(['']);
    const [recipe, setRecipe] = useState({
        name: '',
        ingredients: '',
        description: '',
        cuisine: '',
        typeOfMeal: '',
        dietaryRestrictions: '',
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setRecipe((prev) => ({ ...prev, [name]: value }));
    };

    const handleStepChange = (index, value) => {
        const newSteps = [...steps];
        newSteps[index] = value;
        setSteps(newSteps);
    };

    const addStep = () => setSteps([...steps, '']);
    const removeStep = (index) => setSteps(steps.filter((_, i) => i !== index));

    const handleSubmit = (e) => {
        e.preventDefault();
        onAddRecipe({ ...recipe, steps });
        onClose();
    };

    return (
        <div className="modal">
            <div className="modal-content">
                <button className="close" onClick={onClose}>
                    &times;
                </button>
                <h2>Create New Recipe</h2>
                <div className="form-scroll">
                    <form onSubmit={handleSubmit}>
                        <input
                            type="text"
                            name="name"
                            placeholder="Name of the Dish"
                            value={recipe.name}
                            onChange={handleInputChange}
                            required
                        />
                        <input type="file" name="image" />

                        <textarea
                            name="ingredients"
                            placeholder="Ingredients Used"
                            value={recipe.ingredients}
                            onChange={handleInputChange}
                        />
                        <input
                            type="text"
                            name="description"
                            placeholder="Description (max 60 characters)"
                            value={recipe.description}
                            onChange={handleInputChange}
                            maxLength={60}
                        />
                        <input
                            type="text"
                            name="cuisine"
                            placeholder="Cuisine"
                            value={recipe.cuisine}
                            onChange={handleInputChange}
                        />
                        <select
                            name="typeOfMeal"
                            value={recipe.typeOfMeal}
                            onChange={handleInputChange}
                        >
                            <option value="">Select Type of Meal</option>
                            <option value="breakfast">Breakfast</option>
                            <option value="lunch">Lunch</option>
                            <option value="dinner">Dinner</option>
                        </select>
                        <input
                            type="text"
                            name="dietaryRestrictions"
                            placeholder="Dietary Restrictions (e.g., Vegan)"
                            value={recipe.dietaryRestrictions}
                            onChange={handleInputChange}
                        />

                        <div className="steps-container">
                            <h4>Steps:</h4>
                            {steps.map((step, index) => (
                                <div className="step-input" key={index}>
                                    <input
                                        type="text"
                                        value={step}
                                        onChange={(e) =>
                                            handleStepChange(index, e.target.value)
                                        }
                                        placeholder={`Step ${index + 1}`}
                                    />
                                    <button
                                        type="button"
                                        className="remove-step-btn"
                                        onClick={() => removeStep(index)}
                                    >
                                        Remove
                                    </button>
                                </div>
                            ))}
                        </div>

                        <button
                            type="button"
                            className="add-step-btn"
                            onClick={addStep}
                        >
                            Add Step
                        </button>

                        <button type="submit" className="add-recipe-btn">
                            Add Recipe
                        </button>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default CreateRecipe;
